Whether you are a student, a tourist or a local, Transport Urban is the perfect journey planner kit: map, stops, routes, directions and everything else you might need, all wrapped up in a smooth interface. Plan your routes in seconds, share them with your friends or save them for later viewing, buy tickets & subscriptions*.

Features:
- clean and easy to use interface;
- map with bus / tram / subway stations;
- easy to understand, step-by-step directions;
- estimated distances, times and journey costs;
- visual feedback: view / explore your route on the map;
- search: streets & relevant points of interest;
- gps: set your current location as departure / arrival point;
- advanced planning options;
- Romanian & English languages;
- always up to date.

* tickets and/or subscriptions are currently available only in selected cities.

Note: Internet connection required - no offline mode (yet). To ensure fast and up to date results, route calculations are performed by our web server.

Visit our full-featured web app at: www.transporturban.ro

